import React, { Component } from 'react';
import gh from '../images/github';
import fb from '../images/facebook';
import linkedin from '../images/linkedin';

class Social extends Component {
    render() {
        return (
            <div className="socialLinks">
                <a href="https://www.linkedin.com/in/joshua-yun-9709b0170/" target="_blank"><img src={linkedin} alt="https://www.linkedin.com/in/joshua-yun-9709b0170/"></img></a>
                <a href="https://www.facebook.com/joshposh555/" target="_blank"><img src={fb} alt="https://www.facebook.com/joshposh555/"></img></a>
                <a href="https://github.com/fizzyjosh555" target="_blank"><img src={gh} alt="https://github.com/fizzyjosh555"></img></a>
            </div>
        )
    }
}

export default Social;
